ibuted to the system.'=>'Se verdadeiro, esta nota será atribuída ao utilizador actual. Se falso, a nota será atribuída ao sistema.','Limit response to reviews published before a given ISO8601 compliant date.'=>'Limite a resposta a revisões publicadas antes de uma determinada data em conformidade com a norma ISO8601.','Limit result set to reviews assigned a specific status.'=>'Limitar conjunto de resultados a revisões com um estado específico.','Limit result set to reviews assigned to specific product IDs.'=>'Limitar o conjunto de resultados a avaliações atribuídas a ID de produtos específicos.','Limit result set to reviews assigned to specific user IDs.'=>'Limitar o conjunto de resultados a avaliações atribuídas a ID de utilizadores específicos.','Limit result set to that from a specific author email.'=>'Limita o resultado para um e-mail de um autor específico.','Review type name.'=>'Nome do tipo de avaliação.','Shipping instance ID.'=>'ID da instância de envio.','Supported features for this payment gateway.'=>'Funcionalidades suportadas para este método de pagamento.','Unique identifier for the product that the review belongs to.'=>'Identificador exclusivo do produto ao qual a avaliação pertence.','WooCommerce Customer Orders'=>'Encomendas do cliente WooCommerce','WooCommerce Customer Payment Tokens'=>'Tokens de pagamento do cliente WooCommerce','Thanks for shopping with us'=>'Obrigado por comprar na nossa loja','WooCommerce Customer Downloads'=>'Descarregamentos de clientes WooCommerce','<strong>Your theme (%s) contains outdated copies of some WooCommerce template files.</strong> These files may need updating to ensure they are compatible with the current version of WooCommerce. Suggestions to fix this:'=>'<strong>O seu tema (%s) contém cópias de alguns modelos de ficheiros do WooCommerce desactualizados.</strong> Estes ficheiros podem necessitar de actualização para assegurar a compatibilidade com a versão actual do WooCommerce. Sugestões para corrigir:','The "%s