os.','What we share with others'=>'O que partilhamos com outros','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Os membros da nossa equipa têm acesso a esta informação para satisfazer encomendas, processar devoluções e apoio ao cliente.','Customer information like your name, email address, and billing and shipping information.'=>'As informações do cliente como o nome, email e morada de facturação e envio.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Informações da encomenda, o que comprou, quando comprou e para onde será enviar, e','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Os membros da nossa equipa tem acesso a informação que nos fornece. Por exemplo, os administradores e gestores de loja podem aceder a:','Who on our team has access'=>'Quem na nossa equipa tem acesso','We will also store comments or reviews, if you choose to leave them.'=>'Guardamos comentários ou avaliações.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Em geral, armazenamos informações sobre si enquanto precisamos desses dados para os motivos que os colectamos, e não somos obrigados, por lei, a continuar a mantê-los. Por exemplo, armazenaremos informações por XXX anos para fins fiscais e contabilísticos. Isso inclui o seu nome, endereço de email, morada de facturação e envio.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Se criar uma conta, guardamos o seu nome, morada, email e