envio: iremos pedir-lhe para, por exemplo, estimar os custos de transporte antes de efectuar uma encomenda!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Localização, endereço IP e tipo de navegador: utilizaremos para estimativa de impostos e transporte','While you visit our site, we’ll track:'=>'Enquanto você visita o nosso site, vamos registar:','What we collect and store'=>'O que recolhemos e armazenamos','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Este exemplo inclui o básico relativamente aos dados pessoais que a sua loja poderá estar a colectar, armazenar e partilhar, bem como quem pode ter acesso a esses dados. Dependendo das configurações activas e quais plugins adicionais são utilizados, as informações específicas partilhadas pela sua loja irão variar. Recomendamos consultoria com um advogado ao decidir quais informações divulgar na sua política de privacidade.','We collect information about you during the checkout process on our store.'=>'Recolhemos informações sobre si durante o processo de finalização de compra na nossa loja.','Token'=>'Token','Payment Tokens'=>'Tokens de pagamento','Browser User Agent'=>'Agente do navegador do utilizador','Items Purchased'=>'Produtos comprados','Order Number'=>'Número da encomenda','Access granted'=>'Acesso permitido','Download count'=>'Contagem de descarregamentos','User email'=>'Email do utilizador','Access to Purchased Downloads'=>'Acesso a descarregamentos comprados','Purchased Downloads'=>'Descarregamentos comprados','Removed payment token "%d"'=>'Token de pagamento removido "%d"','Customer download